import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    var container = {
      width: "600px",
      height: "600px",
      backgroundColor: "#000000"
    }
    return (
      <div className="App">
        <div className="container" style={container}>
        </div>
      </div>
    );
  }
}

export default App;
